      SELECT * FROM tab2 (FORMAT parquet) WHERE NOT ( NOT ( 64 / - + ( - + col2 ) ) NOT BETWEEN + 2 AND + 26 );
  - name: tab2

outputs:
  - name: q11380.out
    data: |
      64	77	40
      75	67	58
